"4e4d7d0e-8b89-4682-860d-847841b8b9b9","MAX/MAX","Refers to roles where candidates are highly skilled and in short supply, and are therefore ‘picky’ about the role they are searching for (e.g. looking for the best salary, working conditions, career progression prospects, etc.). In Max/Max, advertisers are also picky – they only want to hire the best candidate for the role. Rather than looking for ‘just anyone’ who can fill the role, the advertiser is looking for a candidate who meets a wide range of specific requirements, which may include hard factors such as qualifications and experience and softer factors like cultural fit, values, etc. Max/Max or (Max-Max or Max Max) roles are often found in specialist fields. Example Roles: Geologists, User Experience Experts, CEOs",
