"592773f5-697f-43c1-ba8a-b00d1aa1b45b","Page Views","(see also Page Impressions) Omniture site metrics term. The Nielsen/NetRatings term is Page Impressions. A page view occurs when a visitor accesses a page on your web site. A Page View is recorded each time a page instrumented with Omniture code is displayed in a user's browser This will occur whether the page is served directly from the web server, from a proxy, or from the browser’s cache.",
