"5ca3f7d1-8899-4274-92a4-9f42e2a2a7bb","Standout Ads","Written as StandOut ads and also referred to as Enhanced Ads during the development phase.  They have 3 additional bullets and the ability to have a customer specific logo and has differential pricing between recruiter and non-recruiter advertisers. See StandOut Ad project 2007",
