"c7a5c421-0bbf-4a7b-9be7-7fc78f7f16fc","Single-Page Visit","An Omniture site metrics term that shows you the pages of your web site that visitors enter and exit without taking steps to view any other pages on your web site. The data listed in this report identifies the number of your site's Single-page Visits and where your visitors enter and exit without viewing additional content.",
"c871b90d-4263-4deb-b057-cbbe44487088","RELOADS","An Omniture site metrics term. Counted when the same pageName is loaded twice.Some examples of reloads are defined below: By clicking Refresh, the original page loads into the browser. Reloads that are automatically refreshed by the web site. By leaving the site completely, accessing another site, and then clicking the Back Button so that the original page loads into the browser NOTE: If you have a page displayed in the browser for over 30 minutes, and then you click Refresh, SiteCatalyst does not register a reload because the visit  has been terminated and a new visit has begun.",
"d04c0279-1442-4502-b376-0ed9a22f1bc0","FAJA","A 2012 project to update our Search process.","Find A Job Ad"
"df00f382-0594-46ce-8c85-123b3f93efda","Multi-Listed Ads","Creating an ad once, but having it appear in more than one area e.g. Main/Exec or Main/Grad. See Dual-list and MAJA (Mirror a job ad).",
"df2c6ba1-dbcd-4064-92a3-0406565ccb36","PTS","   This differs from our standard Talent Search product as it provides hirers with more flexible ways to search for candidates. While standard Talent Search allows the hirer to search Profiles that match a live job ad on their account,    Premium Talent Search does this and more, allowing the hirer to openly search our entire database of over five million Profiles using refinements like location, title, company name or skills. It also includes the Approachability Signal which    helps hirers to easily gauge if a candidate may be actively looking and therefore more receptive to new opportunities. This is a paid upgrade to the standard Talent Search (which allows Hirers to search all candidates for a particular job ad). This allows Hirers to search for candidates that matches a job ad criteria, or to initiate an unrestricted search using their own search terms.","Premium Talent Search"
"e1fda4c6-4fc7-49df-8ece-b062c8b7536a","ASP.NET MVC","A more modern replacement to WebForms, providing a lighter weight approach to web development.",
"e437de37-76cc-43e9-b4f8-80343b85510d","LO","This allows jobseekers to apply directly for a job on the Advertisers website linking directly to the Advertisers application tracking system. Statistics of LinkOut starts are stored but no record of whether applications are completed can be logged.","LinkOut"
