"e9109b04-1c7d-4db1-97d8-227b48f6b242","JobMail VISITS","An Omniture site metrics term. A visit to the site which has originated from a click on a link in the JobMail email.",
"ea7df4b9-280c-499d-aaa4-2cc8dbc5eb7a","UDDI","Is a directory for storing information about web services, is a directory of web service interfaces described by WSDL, communicates via SOAP and is built into the Microsoft .NET platform","Universal Description, Discovery and Integration"
"eb793c4b-18ea-4c6e-a308-7c68349ade14","Eyeball Minutes","A Nielsen/NetRatings market intelligence term. The total amount of time, reported in thousands of seconds, of all UBs spent on site in the reporting period (excluding time spent on final page of session, which cannot be measured). This is calculated by multiplying Page Impressions (PI) by Average Page Duration (APD).  The time spent on the final page of every visit is not capturable by Nielsen, refer to Hitwise Average Visit Time reports.",
"f06eb3ff-bf8e-4f25-a5f6-23592e73b181","SDLC","The old SEEK SDLC can be found here: http://teams/IT/Shared%20Documents/IT%20Processes/SDLC. In 2012 this was superseded by the Agile software development life cycle.","Software Development Lifecycle"
"f08ee36c-d259-4559-8b14-8cd0c6dcada4","SMART","SEEK Manager Replacement Tool – SMART pages were created to replace Seek Manager functionality that SAP couldn't support. e.g. If we need to modify a job ad we use SMART pages as SAP doesn’t store all information about a job ad.","SEEK Manager Replacement Tool"
