"fa59ab16-f2eb-45be-b29f-a460ebc21dee","Time Spent On Page","(also Average page duration) (An Omniture site metrics term. The Nielsen/NetRatings terms is Average page duration.) The amount of time (in minutes) that a visitor spends on a particular page on average.  It should be noted that the time spent on the final page of every visit is not capturable by Omniture To understand true time, refer Hitwise Average Visit Time reports.",
