"0528eab2-8432-4c81-bd7a-bfffb12f9b87","Referrers","An Omniture site metrics term. A domain or URL used outside of your defined domain to access your site. The Referring Domains Report and the Referrers Report break referrer data into domains and URLs so that you can view the instances that visitors access your site from a particular domain or URL. For example, if a visitor clicks a link from Site A and arrives at your site, Site A is the referrer if it is not defined as part of your domain.",
"08747922-4569-4564-9d20-64d3f6943fed","SCM","Software Configuration Management is a team within IT. The Primary role of SCM is to facilitate the speedy movement of completed packages of software to Production in a consistent and reliable manner. See @SCM - Software Configuration Management.","Software Configuration Management"
