"0db25832-633b-45d4-9675-8c30cbe58dfe","Average Page Duration (also Time spent on page)","A Nielsen/NetRatings site metrics term. The Omniture term is Time spent on page.The average time all pages (except for the final page in a session) were viewed on the browser screen for a selected period. This metric is calculated by dividing the total duration of Page Impressions that are less than 30 minutes by the number of Page Impressions. Note: If a page impression lasts 30 minutes or greater it is assumed that the page is no longer being viewed. This is removed from the total duration as it may distort the data.  The time spent on the final page of every visit is not capturable by Nielsen. True time is calculated by the Hitwise Average Visit Time reports.",
