"80d13aaa-fee4-4902-bfb6-dae29b956b39","SKU","SKU is an internal front-end development toolkit, powered by Webpack, Babel, CSS Modules, Less, ESLint, Prettier, Jest and Storybook. Quickly get up and running with a zero-config development environment, or optionally add minimal config when needed.  Github repo here: https://github.com/seek-oss/sku",
