"8f219ed2-d272-481e-b435-4d3cf2c6af4d","SSO","A property of access control of multiple related, yet independent, software systems. With this property, a user logs in with a single ID and password to gain access to a connected system or accomplished using the Lightweight Directory Access Protocol (LDAP) and stored LDAP databases on (directory) servers","Single Sign On"
