"f9d1cbe5-feed-4262-b7ab-40c13329fd56","Page Impressions","See also Page Views A Nielsen/NetRatings site metrics term. The Omniture term is Page Impressions. A page view occurs when a visitor accesses a page on your web site. A Page Impression is recorded each time a page instrumented with the Nielsen//NetRatings code is displayed in a user's browser. This will occur whether the page is served directly from the web server, from a proxy, or from the browser’s cache.",
